    yystate(12, Ics, Line, Tlen+1, 8, Tlen);
yystate(1, Ics, Line, Tlen, _, _) ->
    {8,Tlen,Ics,Line,1};
yystate(0, Ics, Line, Tlen, _, _) ->
    {0,Tlen,Ics,Line};
yystate(S, Ics, Line, Tlen, Action, Alen) ->
    {Action,Alen,Tlen,Ics,Line,S}.

